import React from 'react'

export default function Login() {

      const [credentials, setCredentials] = useState({email: "", password: ""});
      const onSubmit = async (e) => {
            e.preventDefault();
            const response = await fetch(`http://localhost:5000/api/auth/login`, {
                  method: "GET",
                  headers: {
                    "Content-Type": "application/json",
                    "auth-token":
                      "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyIjp7ImlkIjoiNjUwODM5ZjUxOThjMWIxMjk5MDVjMmQwIn0sImlhdCI6MTY5NTAzNzk2OX0.mVK3gm2Iu7I4wjyGweOkoVj3qYHZXMX2Qu3lvYgHXiI",
                  },
                  body: JSON.stringify({ email: credentials.email, password: credentials.password }),
            });
      };

      const onchange = (e) => {
            setCredentials({...credentials, [e.target.name]: e.target.value});
      };

  return (
    <div className="container">
<form>
  <div className="form-group my-2">
    <label htmlFor="exampleInputEmail1">Email address</label>
    <input type="email" className="form-control" id="email" aria-describedby="emailHelp" 
    onchange={onchange}
    placeholder="Enter email"/>
  </div>
  <div className="form-group">
    <label htmlFor="exampleInputPassword1">Password</label>
    <input type="password" className="form-control" id="password" onchange={onchange} placeholder="Password"/>
  </div>
  <button type="submit" className="btn btn-primary my-2" onClick={onSubmit}>Submit</button>
</form>
    </div>
  );
}
